INSERT INTO config.i18n_core (fq_field, identity_value, translation, string) VALUES ('coust.description', 'circ.staff_client.do_not_auto_attempt_print', 'es-ES', 'Deshabilitar los intentos de impresión automática de interfaces de cliente personal para los tipos de recibos en esta lista. Valores posibles: "Pedido", "Bill Pay", "Hold Slip", "Tránsito Slip", y "Hold / Separador de tránsito". Esto es diferente de la casilla de verificación de impresión automática de las interfaces pertinentes en que se desactiva por completo los intentos de impresión automática, en lugar de alentar impresión silenciosa suprimiendo el diálogo de impresión. La casilla de verificación de impresión automática en estas interfaces no tienen ningún efecto sobre el comportamiento de este parámetro. En el caso de la bodega, Tránsito y Hold / Tránsito se desliza, esto también suprime los cuadros de diálogo de alerta que preceden al diálogo de impresión (los que ofrecen impresión y no se imprimen según las opciones).');
