INSERT INTO config.i18n_core (fq_field, identity_value, translation, string) VALUES ('coust.description', 'opac.org_unit_hiding.depth', 'es-ES', 'Esto ocultará ciertas unidades organizativas en el OPAC pública si la ubicación física (url param "physical_loc") para el OPAC hereda esta configuración. Este ajuste especifica una profundidad unidad organizativa, que junto con el OPAC ubicación física determina qué sección de la Org Jerarquía debe ser visible en el OPAC. Por ejemplo, una instalación de archivo de hoja perenne tendrá una jerarquía de 3 niveles (Consorcio / Sistema / Sucursal), donde el sistema tiene una profundidad de 1 y Rama tiene una profundidad de 2. Si este parámetro contiene una profundidad de 1 en una instalación de este tipo, a continuación, todas las bibliotecas del sistema en el que la ubicación física pertenece será visible, y todo lo demás será ocultado. Una profundidad de 0 será efectivamente hacer todo Org visible. El OPAC incrustado en la interfaz del personal ignora este ajuste.');
